def get_all_parts():
    return PARTS

def get_single_part(id):
    requested_part = None
    for part in PARTS:
        if part["id"] == id:
            requested_part = part
    return requested_part

def create_part(part):
    max_id = PARTS[-1]["id"]
    new_id = max_id + 1
    part["id"] = new_id
    PARTS.append(part)
    return part